import React from "react";
import "./style.css";
import "bootstrap/dist/css/bootstrap.css";
import { Link } from "react-router-dom";
export default class Logs extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      data: [],
      continents: [],
    };
  }

  componentDidMount() {
    document.title = "Logs";
    fetch("http://localhost:4000/api/logs")
      .then((response) => {
        return response.json();
      })
      .then((json) => {
        this.setState({
          data: json,
        });
      });
    fetch("http://localhost:4000/api/continents")
      .then((response) => {
        return response.json();
      })
      .then((json) => {
        this.setState({
          continents: json,
        });
      });
  }
  render() {
    return (
      <div className="container-fluid">
        <thead>
          <tr className="row">
            <th className="col">Continent</th>
            <th className="col">Country</th>
            <th className="col">Trip Year</th>
            <th className="col">Log</th>
            <th className="col"></th>
          </tr>
        </thead>
        <tbody>
          {this.state.data.map((each) => (
            <tr key={each.id} className="row">
              <td className="col">
                {this.state.continents.map((continent) => {
                  continent.id === each.continent;
                })}
              </td>
              <td className="col">{each.country}</td>
              <td className="col">{each.year}</td>
              <td className="col">
                {" "}
                <Link to={`/logs/${each.id}`}>{each.title}</Link>
                <td className="col"></td>
              </td>
            </tr>
          ))}
        </tbody>
      </div>
    );
  }
}
